import React from 'react';
import './App.css';
import Home from './components/dashboard/home';
import Login from './components/login';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Graph from './components/dashboard/graph';
import AOS from 'aos';
import 'aos/dist/aos.css';
import {useSelector} from 'react-redux';
import PricesGuard from './components/pricesGuard';
import GraphGuard from './components/graphGuard';



AOS.init({
  duration: 1000,
  easing: "ease-in-out",
  once: true,
  mirror: false,
});

function App() {
  const isLogged = useSelector(state=> state.isLogged)
  return (
    <React.Fragment>
      <Router>
        <Switch>
          <Route exact path='/'>
          <Login/>
          </Route>

          <PricesGuard path='/dashboard' component={Home} isLogged={isLogged}/>

          <GraphGuard path='/graph' component={Graph} isLogged={isLogged}/>


          <Route exact path='/graph'>
          <Graph/>
          </Route>

        </Switch>
      </Router>


    </React.Fragment>
  );
}

export default App;
